import axios from 'axios';

const axiosApi = axios.create({
	baseURL: 'https://api.themoviedb.org/3',
	headers: {
		'Access-Control-Allow-Origin': '*',
		'Content-Type': 'application/json',
	},
	withCredentials: false,
});

export default axiosApi;
